import React, { Component } from 'react'
import './about.scss'

class About extends Component{
    render(){
        return(
            <>
            <div className="about__heading--wrapper">
                <h1 className="about__heading">FirstEdition</h1>
                <h3 className="about__sub-heading">A Website for People to Post Their Creative Work, recieve likes, comments, as well as meaningful Edits</h3>
            </div>
            <div>
                <iframe src="https://mikesfirstedition.herokuapp.com/" height="1000px" width="100%" title="FirstEdition"></iframe>
            </div>
            </>
        )
    }
}
export default About
